import React, { Component } from 'react';


import { Navbar, NavItem, Icon, SideNav, SideNavItem } from 'react-materialize';
import SideMenu from './SideMenu';


class Nav extends Component {
    render () {
        return  <div>
            <Navbar
        alignLinks="right"
        brand={<Icon>menu</Icon>}
        menuIcon={<Icon>menu</Icon>}
        options={{
          draggable: true,
          edge: 'left',
          inDuration: 250,
          onCloseEnd: null,
          onCloseStart: null,
          onOpenEnd: null,
          onOpenStart: null,
          outDuration: 200,
          preventScrolling: true
        }}
      >

      </Navbar>
      <SideNav 
      options={{
        closeOnClick: true
      }}
      trigger={<a href="#"><Icon>apps</Icon></a>}>
        <SideNavItem
        user={{
        background: 'https://placeimg.com/640/480/tech',
        email: 'jdandturk@gmail.com',
        //   image: 'static/media/react-materialize-logo.824c6ea3.svg',
        name: 'John Doe'
        }}
        userView
        />
        <SideNavItem
        href="#!icon"
        icon="cloud"
        >
        First Link With Icon
        </SideNavItem>
        <SideNavItem href="#!second">
        Second Link
        </SideNavItem>
        <SideNavItem divider />
        <SideNavItem subheader>
        Subheader
        </SideNavItem>
        <SideNavItem
        href="#!third"
        waves
        >
        Third Link With Waves
        </SideNavItem>
        </SideNav>
        </div>
    }
}

export default Nav
